import React from 'react';
import Nav from './Nav/Nav';
import './Material.css';

const Material = () => {
  // Example data
  const detailsData = [
    {
      mainDetails: {
        name: 'John Doe',
        date: '2024-03-12',
        dueDate: '2024-03-20',
        material: 'Book',
        studentId: '12345',
        description: 'Lorem ipsum',
        action: 'Read',
      },
      additionalDetails: {
        grade: 'A',
        status: 'Completed',
        comments: 'Excellent work',
      },
    },
    // Add more data as needed
  ];

  return (
    <div className='materialContainer'>
      <Nav />
      <p className='title'>Student Details</p>
      <div className='contentContainer2'>
        <div className='infoRow'>
          <p className='name'>Name</p>
          <p className='date'>Date</p>
          <p className='duedate'>Due Date</p>
          <p className='materials'>Material</p>
          <p className='sid'>Student ID</p>
          <p className='des'>Description</p>
          <p className='action'>Action</p>
        </div>
        {detailsData.map((details, index) => (
          <div key={index}>
            <div className='infoRow'>
              <p className='name'>{details.mainDetails.name}</p>
              <p className='date'>{details.mainDetails.date}</p>
              <p className='duedate'>{details.mainDetails.dueDate}</p>
              <p className='materials'>{details.mainDetails.material}</p>
              <p className='sid'>{details.mainDetails.studentId}</p>
              <p className='des'>{details.mainDetails.description}</p>
              <p className='action'>{details.mainDetails.action}</p>
            </div>
            <div className='additionalDetails'>
              <p>Grade: {details.additionalDetails.grade}</p>
              <p>Status: {details.additionalDetails.status}</p>
              <p>Comments: {details.additionalDetails.comments}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Material;
